    false,nt"url": null,nt"notes": "The data in this submission consists of
    three files. It represents allnof the Caripol Phase I data spanning a period of
    10 years on file atnAtlantic Oceanographic and Meteorological Laboratory (AOML)
    as of Julyn1989. The data were submitted by Dr. Donald K. Atwood. These data werencollected
    by many institutes in the United States, Caribbean, Centralnand South America. The
    data were collected in the Gulf of Mexico andnCaribbean Sea. One file contains the
    data regarding amount of tar on thenbeaches. The data were collected from February
    1979 to February 1989.nSecond file contains the dissolved and dispersed petroleum
    hydrocarbonndata collected from November 1979 to February 1989. The third filencontains
